(10, 1, 14000, 14000, 'Site Category', ' ', '', 'acl-site', '<p>Site category is the highest level category used for permission assignment. Any unassigned content defaults to this category.</p>', 2, 0, 0, 1, '2015-02-01 00:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2015-02-01 00:00:00', 1, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 0, 0, 0, 0, 0, 0, 0, '', '{}', '{}', 'en-GB', 0, 1),
